import React, { useDebugValue } from "react";
import {CrecheUserx} from '../../../data';
import { useLocation } from 'react-router-dom';

import CrecheCard from "./CrecheCard";

const CrecheDesc = () => {
    const location = useLocation();
    const params = new URLSearchParams(location.search);
    const name = params.get('name');
  
    const filteredItems = CrecheUserx.filter(item => item.name === name);
  
    return (
      <div className="w-full grid  ">
        {filteredItems.map(item => (
          <div>
        <h1>boooo {item.name}  {item.Location} </h1> 
           
            <img className=" mx-auto mt-2 w-[80%] " src={item.image} alt="" />
         
          </div>
        ))}
      </div>
    );
  };
  
 export default CrecheDesc;
